-- HASHTABLE or Matrix giving correspondence from Index to a value per Key
-- for example, key = 'CTRY' , each index has a list of country code identifi
CREATE TABLE ref_holding.INDEX_HASHTABLE
 (
 	[Id] [bigint] NOT NULL,
	[ISIN] [nchar](12) NOT NULL,
	[Date] [datetime] NOT NULL,
	[Name] [nvarchar](350) NULL,
	
	[Key] [nchar](4) NOT NULL,
	[ValueCode] [nvarchar](12) NULL,
	[ValueName] [nvarchar](max) NULL,
 )
 
 
 
select * from ref_holding.INDEX_HASHTABLE


delete from ref_holding.INDEX_HASHTABLE where [KEY] = 'CTRY'



